Congress passed the HALT Fentanyl Act, sending it on to President Trump for his signature. 

The bill permanently classifies chemically altered fentanyl substances as Schedule I drugs, cracking down on drug traffickers and securing the highest penalty for all altered fentanyl substances. 

Deadly fentanyl poisoning has claimed far too many lives in Kentucky and across the country. In fact, over 62% of all overdose deaths in the Commonwealth were a result of fentanyl poisoning in 2024, according to the Kentucky Office of Drug Control Policy. 
